description:
Hey folks! I took this from a Russian website where you had to register and I'm putting it up here for convenience. The music files are wv, which are NOT renamed wav files. They're WavPack files so use a program to extract them to the audio file of your choice. I used the program MediaCoder. I'm just seeding until I get a few seeders on here, and if someone snags this and wants to put it up as, say the more popular FLAC format, then by all means do it. Also, my internet connection bites so please bear with me. I'll be seeding for at least the first 24 hours nonstop.

